// Minimal typed.min.js implementation
// This is a placeholder for the actual Typed.js library
// In a real scenario, you would include the full typed.min.js file

class Typed {
  constructor(selector, options) {
    this.element = document.querySelector(selector);
    this.options = options || {};
    this.strings = this.options.strings || [];
    this.typeSpeed = this.options.typeSpeed || 50;
    this.backSpeed = this.options.backSpeed || 30;
    this.loop = this.options.loop || false;
    this.currentIndex = 0;
    
    if (this.element) {
      this.init();
    }
  }
  
  init() {
    this.type();
  }
  
  type() {
    const currentString = this.strings[this.currentIndex];
    this.element.textContent = currentString;
    
    if (this.loop) {
      setTimeout(() => {
        this.currentIndex = (this.currentIndex + 1) % this.strings.length;
        this.type();
      }, 2000);
    }
  }
}
